This is a list of '''[[free and open source software|free and open source]] [[software package (installation)|software package]]s''': [[computer software]] licensed under [[free software license]]s and [[open source license]]s. Software that fits the [[Free Software Definition]] may be more appropriately called [[free software]]; the [[GNU project]] in particular objects to their works being referred to as [[open source]].<ref>{{cite web |url=http://www.gnu.org/philosophy/open-source-misses-the-point.html |title=Why Open Source misses the point of Free Software |author=Richard Stallman |date=July 13, 2011 |accessdate=August 24, 2011}}</ref> For more information about the philosophical background for open source software, see [[free software movement]] and [[Open Source Initiative]]. However, nearly all software meeting the [[Free Software Definition]] also meets the [[Open Source Definition]] and vice versa. A small fraction of the software that meets either definition is listed here.
